import React, { useState } from "react";
import "./App.css";
import Box from "@mui/material/Box";
import Stack from "@mui/material/Stack";
import Paper from "@mui/material/Paper";
import { ThemeProvider, createTheme, Typography } from "@mui/material";
import background from "./backg.png";
import sparkle from "./sparkle.png";

import FlashcardList from "./FlashcardList";
import Appbar from "./components/Appbar";
import Education from "./components/Education";
import Design from "./components/Design";
import Contacts from "./components/Contacts";
import Introduction from "./components/Introduction";
import Work from "./components/Work";


const flashcard_component = [
  {
    id: 1,
    project_name: "Website development",
    details: "A personal project I did to learn React and MUI.",
    additional: "I spent time outside of my internship to design and implement features that were visually appealing and to my liking.",
    pills: ["React", "JSX", "MUI", "CSS"],
  },
  {
    id: 2,
    project_name: "Data Visualization Hackathon",
    additional: "I worked on creating the visualization for Michigan, where I had to clean the data from scratch and make an eye-catchng visualization.",
    details: "Worked in a group of 5 to create a data visualization of opioid overdose data.",
    pills: ["Tableau", "Python", "Excel", "Wix"],
    relevant_course: ["Data Visualization", "Python Programming"]
  },
];

function App() {
  const [flashcards, setFlashcards] = useState(flashcard_component);

  const mystyle={
    backgroundImage: `url(${background})`,
    marginLeft: 1130,
    marginTop:'-350px',
    height:'500px',
    backgroundRepeat: 'no-repeat',
  }

  const spark={
    backgroundImage: `url(${sparkle})`,
    marginLeft: 110,
    marginTop:'-300px',
    height:'500px',
    backgroundRepeat: 'no-repeat',
  }

  const theme = createTheme({
    typography: {
      h1: {
        fontFamily: "myFirstFont",
      },
      h2: {
        fontFamily: "myFirstFont",
      },
      p: {
        fontFamily: "louis",
      },
      h3: {
        fontFamily: "freesans"
      }
    },
  });

  return (
    <ThemeProvider theme={theme}>
      <Box
        sx={{
          color: "black",
          background:
            "linear-gradient(to right, #b4c0cf, #e8bdbe, #f4d2b5, #d4d5c8)",
        }}
      >
        <Stack className="App">

          <Appbar />

          <Introduction/>
          <br />
          <br />          
          <br />


          <Education />
          <br/>
          <br/>
          <br/>
          <br/>

          <div>
          <Stack direction="row" spacing={2} sx={{ height: "500px", ml: 5,}}>
            <div className="second box">
              <Box
                sx={{
                  bgcolor: "#b5b5b5",
                  borderRadius: 2,
                  width: 800,
                  height: 250,
                }}
              >
                <div class="container">
                  <div class="circle1"></div>
                  <div class="circle2"></div>
                  <div class="circle3"></div>
                </div>
                <Paper
                  elevation={3}
                  sx={{
                    bgcolor: "white",
                    borderRadius: 1,
                    height: 700,
                    fontSize: 24,
                    p: 2
                  }}
                >
                  <br />
                  <Typography variant="h2"> Projects </Typography>
                  <br/>
                  <br/>
                  <FlashcardList flashcards={flashcards}/>
                </Paper>
              </Box>
            </div>

            <Work />

          </Stack>
      </div>
        <br/>
        <br/>

        <div className="third box">
        <Box justifyContent="center">
          <Design/>
        </Box>
        </div>
        <Stack justifyContent="center" sx={{pl: 100}}>
          <Contacts />
        </Stack>
          <br/>
          <br/>
        </Stack>
      </Box>
    </ThemeProvider>
  );
}

export default App;
